export const rightToc = [{
  value: '去哪里排查？',
  id: '去哪里排查？',
  children: []
}, {
  value: '&quot;default backend - 404&quot;',
  id: 'default-backend---404',
  children: [{
    value: 'Rancher 是否在运行',
    id: 'rancher-是否在运行',
    children: []
  }, {
    value: '检查 Rancher 日志',
    id: '检查-rancher-日志',
    children: []
  }]
}, {
  value: '证书 CN 为伪证书',
  id: '证书-cn-为伪证书',
  children: [{
    value: 'cert-manager 发布的证书',
    id: 'cert-manager-发布的证书',
    children: []
  }, {
    value: '您自己提供的证书',
    id: '您自己提供的证书',
    children: []
  }]
}, {
  value: '没有匹配的&quot;Issuer&quot;',
  id: '没有匹配的issuer',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "去哪里排查？"
    }}>{`去哪里排查？`}</h2>
    <p>{`大部分常见问题排查都将在这 3 个命名空间中的对象上进行。`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`cattle-system`}</inlineCode>{` - `}<inlineCode parentName="li">{`rancher`}</inlineCode>{` deployment 和 pods。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ingress-nginx`}</inlineCode>{` - Ingress controller pods 和 services。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`kube-system`}</inlineCode>{` - `}<inlineCode parentName="li">{`tiller`}</inlineCode>{` 和 `}<inlineCode parentName="li">{`cert-manager`}</inlineCode>{` pods。`}</li>
    </ul>
    <h2 {...{
      "id": "default-backend---404"
    }}>{`"default backend - 404"`}</h2>
    <p>{`多数情况下，这是由于 ssl 配置错误所致。`}</p>
    <p>{`请检查以下三项参数是否有误：`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#rancher-%E6%98%AF%E5%90%A6%E5%9C%A8%E8%BF%90%E8%A1%8C"
        }}>{`Rancher 是否在运行`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#%E6%A3%80%E6%9F%A5-rancher-%E6%97%A5%E5%BF%97"
        }}>{`Rancher 日志`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#%E8%AF%81%E4%B9%A6-cn-%E4%B8%BA%E4%BC%AA%E8%AF%81%E4%B9%A6"
        }}>{`证书 CN 为"Kubernetes Ingress Controller Fake Certificate"`}</a></li>
    </ul>
    <h3 {...{
      "id": "rancher-是否在运行"
    }}>{`Rancher 是否在运行`}</h3>
    <p>{`使用`}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`检查`}<inlineCode parentName="p">{`cattle-system`}</inlineCode>{`系统命名空间，并查看 Rancher 容器是否处于 Running 状态。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system get pods

NAME                           READY     STATUS    RESTARTS   AGE
pod/rancher-784d94f59b-vgqzh   1/1       Running   0          10m
`}</code></pre>
    <p>{`如果状态不是`}<inlineCode parentName="p">{`Running`}</inlineCode>{`，则需要在容器上运行`}<inlineCode parentName="p">{`describe`}</inlineCode>{`并检查事件。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system describe pod

...
Events:
  Type     Reason                 Age   From                Message
  ----     ------                 ----  ----                -------
  Normal   Scheduled              11m   default-scheduler   Successfully assigned rancher-784d94f59b-vgqzh to localhost
  Normal   SuccessfulMountVolume  11m   kubelet, localhost  MountVolume.SetUp succeeded for volume "rancher-token-dj4mt"
  Normal   Pulling                11m   kubelet, localhost  pulling image "rancher/rancher:v2.0.4"
  Normal   Pulled                 11m   kubelet, localhost  Successfully pulled image "rancher/rancher:v2.0.4"
  Normal   Created                11m   kubelet, localhost  Created container
  Normal   Started                11m   kubelet, localhost  Started container
`}</code></pre>
    <h3 {...{
      "id": "检查-rancher-日志"
    }}>{`检查 Rancher 日志`}</h3>
    <p>{`使用`}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`查看 pods 列表`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system get pods

NAME                           READY     STATUS    RESTARTS   AGE
pod/rancher-784d94f59b-vgqzh   1/1       Running   0          10m
`}</code></pre>
    <p>{`使用`}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`和 Pod 名称来列出 Pod 中的日志。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system logs -f rancher-784d94f59b-vgqzh
`}</code></pre>
    <h2 {...{
      "id": "证书-cn-为伪证书"
    }}>{`证书 CN 为伪证书`}</h2>
    <p>{`使用浏览器检查证书详细信息。如果 Common Name 是`}<inlineCode parentName="p">{`Kubernetes Ingress Controller Fake Certificate`}</inlineCode>{`，则说明读取或颁发 SSL 证书时可能出了点问题。`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意事项:`}</strong>{` 如果您使用 LetsEncrypt 颁发证书，则有时可能需要花一些时间来等待证书发布。`}</p>
    </blockquote>
    <h3 {...{
      "id": "cert-manager-发布的证书"
    }}>{`cert-manager 发布的证书`}</h3>
    <p>{`Rancher 生成的或是通过 LetsEncrypt 生成的`}</p>
    <p><inlineCode parentName="p">{`cert-manager`}</inlineCode>{` 有 3 部分。`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`kube-system`}</inlineCode>{` 命名空间中的`}<inlineCode parentName="li">{`cert-manager`}</inlineCode>{` pod。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`cattle-system`}</inlineCode>{` 命名空间中的 `}<inlineCode parentName="li">{`Issuer`}</inlineCode>{` 对象。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`cattle-system`}</inlineCode>{` 命名空间中的 `}<inlineCode parentName="li">{`Certificate`}</inlineCode>{` 对象。`}</li>
    </ul>
    <p>{`对每个对象执行`}<inlineCode parentName="p">{`kubectl describe`}</inlineCode>{`并检查事件。您可以追踪可能缺少的东西。`}</p>
    <p>{`例如颁布证书存在问题：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system describe certificate
...
Events:
  Type     Reason          Age                 From          Message
  ----     ------          ----                ----          -------
  Warning  IssuerNotReady  18s (x23 over 19m)  cert-manager  Issuer rancher not ready
`}</code></pre>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system describe issuer
...
Events:
  Type     Reason         Age                 From          Message
  ----     ------         ----                ----          -------
  Warning  ErrInitIssuer  19m (x12 over 19m)  cert-manager  Error initializing issuer: secret "tls-rancher" not found
  Warning  ErrGetKeyPair  9m (x16 over 19m)   cert-manager  Error getting keypair for CA issuer: secret "tls-rancher" not found
`}</code></pre>
    <h3 {...{
      "id": "您自己提供的证书"
    }}>{`您自己提供的证书`}</h3>
    <p>{`您的证书将直接应用于`}<inlineCode parentName="p">{`cattle-system`}</inlineCode>{`命名空间中的 Ingress 对象。`}</p>
    <p>{`检查 Ingress 对象的状态，并查看其是否准备就绪。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system describe ingress
`}</code></pre>
    <p>{`如果其就绪并且 SSL 仍无法正常工作，则您的证书或密码可能格式错误。`}</p>
    <p>{`检查 nginx-ingress-controller 日志。由于 nginx-ingress-controller 的容器中有多个容器，因此您需要指定容器的名称。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx logs -f nginx-ingress-controller-rfjrq nginx-ingress-controller
...
W0705 23:04:58.240571       7 backend_ssl.go:49] error obtaining PEM from secret cattle-system/tls-rancher-ingress: error retrieving secret cattle-system/tls-rancher-ingress: secret cattle-system/tls-rancher-ingress was not found
`}</code></pre>
    <h2 {...{
      "id": "没有匹配的issuer"
    }}>{`没有匹配的"Issuer"`}</h2>
    <p>{`您选择的`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/helm2/helm-rancher/_index"
      }}>{`SSL 配置`}</a>{`要求在安装 Rancher 之前先安装`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/helm2/helm-rancher/_index"
      }}>{`cert-manager`}</a>{` ，否则将显示以下错误:`}</p>
    <pre><code parentName="pre" {...{}}>{`Error: validation failed: unable to recognize "": no matches for kind "Issuer" in version "certmanager.k8s.io/v1alpha1"
`}</code></pre>
    <p>{`安装`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/helm2/helm-rancher/_index"
      }}>{`cert-manager`}</a>{` 并重新尝试安装 Rancher。`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
